  false,\n\t\"url\": null,\n\t\"notes\": \"This accession contains the gridded 5-day
  mean sea surface height anomaly (SSHA) and Ku Band significant wave height (SWH-KU)
  observed from Jason-1 and OSTM/Jason-2 satellites. This dataset has been generated
  in near-real time during the Deepwater Horizon Oil Spill Event in order to provide
  users a quick view on the sea level change and wave activity in the the Gulf of
  Mexico though it is under a global coverage. All the observations within 5 days
  are interpolated into 0.25 longitude degree and 0.25 latitude degree uniform grid.nnThe
  OSTM/Jason-2 observations are picked from Interim Geophysical Data Records (IGDR)
  which is archived under NODC AMS accession 0043269 atnhttp://www.nodc.noaa.gov/cgi-bin/search/prod/accessionsView.pl/details/43269nThe
  Jason-1 satellite IGDR data are selected from PO.DAAC, JPL/NASA atnftp://podaac.jpl.nasa.gov/pub/sea_surface_height/jason/igdr_ssha_netcdf/data/.nnAbove
  original data have been processed, gridded, visualized andnfinally converted into
  NetCDF format by scientists in NODC's satellite oceanography group.nThe data time
  period in this accession has been updated to August 8, 2010 in the latest version.\",\n\t\"license_title\":
